CREATE TABLE CelebrityOutfits (
  id serial PRIMARY KEY,
  celebrity_id INT REFERENCES Celebrities(id),
  outfit_id INT REFERENCES Outfits(id),
  style_id INT REFERENCES FashionStyles(id)
);

CREATE TABLE celebrity (
    id INT PRIMARY KEY,
    name VARCHAR(50) NOT NULL,
    birthdate DATE,
    profession VARCHAR(50)
);

CREATE TABLE fashion_style (
    id INT PRIMARY KEY,
    style_name VARCHAR(50) NOT NULL,
    description TEXT
);

CREATE TABLE clothing (
    id INT PRIMARY KEY,
    category VARCHAR(50) NOT NULL,
